INSERT INTO `tb_chat` (`id`, `project_id`, `user_id`, `message`, `create_time`) VALUES (51, 19, 2, '<h1>全球首位 AI 软件工程师 Devin：能自学新语言、开发迭代 App、自动 Debug</h1>\n<p>&nbsp;</p>\n<p>初创公司 Cognition 近日<u><a href=\"https://www.oschina.net/action/GoToLink?url=https%3A%2F%2Ftwitter.com%2Fcognition_labs%2Fstatus%2F1767548763134964000\" target=\"_blank\" rel=\"noopener\">发布公告</a></u>，宣布推出全球首个 AI 软件工程师 Devin，并号称会彻底改变人类构建软件的方式。</p>\n<p>官方对其的描述如下：Devin 是一位不知疲倦、技术娴熟的队友，随时准备与您并肩作战，或独立完成任务供您审查。有了 Devin，工程师可以专注于更有趣的问题，工程团队可以努力实现更远大的目标。</p>\n<p>Devin 所具备的技能如下：</p>\n<ul>\n<li>快速掌握新技术：只需阅读文档，Devin 就能快速掌握不熟悉的工具和框架；</li>\n<li>开发端到端应用：构建并部署功能齐全的网络应用程序，根据用户反馈逐步增加功能；</li>\n<li>自动化查找 BUG：Devin 擅长识别、调试和修复代码问题，同时为开源和生产级软件仓库作出贡献；</li>\n<li>AI 培训：从研究资料库中获取指令，建立并微调大型语言模型。</li>\n</ul>\n<p>Devin 在 SWE-bench 编码基准测试中取得了突破性的成功，展示了其执行复杂任务的能力，甚至超越了顶尖的人类工程师。</p>\n<p>Devin 擅长长期推理能力，可以自主规划和完成软件项目，并在此过程中做出数以千计的准确决策。</p>', 1711016102);
INSERT INTO `tb_chat` (`id`, `project_id`, `user_id`, `message`, `create_time`) VALUES (52, 19, 2, '<p>?Devin 在 SWE-bench 编码基准测试中取得了突破性的成功，展示了其执行复杂任务的能力，甚至超越了顶尖的人类工程师。</p>', 1711016391);
